import React from 'react'
import sass from './registrationPage.module.sass'
import {ReduxRegistrationForm} from './form'

const RegistrationPage = (props) => {
    const onSubmit = (formData) => {
        console.log(formData)
    }
    return (
        <div id='registrationPage' className={sass.registrationPage}>
            <h1>Register to get a work</h1>
            <p>Attention! After successful registration and alert,
                update the</p>
            <p>list of users in the block from the top</p>
            <ReduxRegistrationForm onSubmit={onSubmit}/>
        </div>
    )
}

export default RegistrationPage
